import React from 'react';
import styles from './styles.module.css';

const Header = () => {
  return (
    <div className={styles.wrapper}>
      <div className='container mx-auto'>
        <img src='/public/logo_paplpitebox.png' alt='PalpiteBox'></img>
      </div>
    </div>
  )
}

export default Header
